import React from "react";
import { Ionicons } from "@expo/vector-icons";

export default function TabBarHomeIcon({ name, focused }) {
  return (
    <Ionicons
      name={name}
      size={25}
      color={focused ? "tomato" : "black"}
      style={{ marginBottom: -10 }}
    />
  );
}
